import React from 'react';
import '../css/stock.css'

function Stock(props) {
    console.log(props);
    return (
        <div className="stock">
            {props.status}({props.ticker.toUpperCase()}) - {props.quantity} shares @ {$props.price}
        </div>
    );
}

export default Stock;
